<body class="awsui aws-signin-ui" style="margin-top: 30px; margin-right:40px; margin-bottom:20px; margin-left:40px;">
        <div id="signin-main-box" class="aws-signin-main-box fixed-width">
                <div id="logo_container" class="aws-signin-logo-header-box">
                    <h1 id="logo_head" class="background-left">
                        <a id="logo_link" class="aws-signin-text-small" href="http://aws.amazon.com/">Amazon Web Services Login</a>
                    </h1>
                </div>
                <div id="main_content" class="main-table">
                    <div id="signin_container" class="aws-signin-float-left">
                        <div id="signin_inner_container" class="aws-signin-login-general-box">

                            <div id="error_message" style="display: none; !important">
                                <div class="awsui-alert-type-error  aws-signin-alert">
                                    <div class="awsui-alert-header awsui-text-big">
                                        <span id="error_title"></span>
                                    </div>
                                    <div>
                                        <span id="error_message_description"></span>
                                    </div>
                                </div>
                            </div>

                            <div id="resolver_container" class="signin-container">
                                <div id="signin_head_box" class="aws-signin-login-header-box">
                                    <b id="signin_head" class="awsui-text-bigger">Sign in</b>
                                    <div class="aws-signin-tool-tip" style="bottom:2px;">
                                        <span class="awsui-icon info-circle awsui-icon-has-hover"></span>
                                        <span class="aws-signin-tooltip-text aws-signin-tooltip-size-medium">
                                            <span>If you are an AWS account owner (root user), you can use your account email to sign in to this page. If an administrator added you to an AWS account, then you are an IAM user. Your administrator should have given you a 12-digit account ID or an account alias to sign in below.</span>
                                        </span>
                                    </div>
                                </div>
                                <div class="aws-signin-general-label-box">
                                    <b id="resolving_input_label" class="awsui-text-normal">Email address of your AWS account</b>
                                </div>
                                <div class="aws-signin-general-label-box">
                                    <span class="aws-signin-display-block aws-signin-color-mid-gray">
                                        <span>To sign in as an IAM user, enter your</span>
                                        <div class="aws-signin-tool-tip">
                                            <span style="text-decoration: underline;">account ID</span>
                                            <span class="aws-signin-tooltip-text aws-signin-tooltip-size-small" style="margin-left:8px;">
                                                <span>A 12-digit account number provided by your administrator</span>
                                            </span>
                                        </div>
                                        <span>or</span>
                                        <div class="aws-signin-tool-tip">
                                            <span style="text-decoration: underline;">account alias</span>
                                            <span class="aws-signin-tooltip-text aws-signin-tooltip-size-small" style="margin-left:8px;">
                                                <span>A friendly account identifier from your administrator that includes alphanumeric characters or dashes</span>
                                            </span>
                                        </div>
                                        <span>instead.</span>
                                    </span>
                                </div>
                                <div class="aws-signin-general-input-box">
                                    <input id="resolving_input" class="aws-signin-textfield" autocorrect="off" autocapitalize="off" type="text">
                                    <div id="resolving_input_alert" style="display:none">
                                        <span id="resolving_account_input_alert_content" class="awsui-text-small aws-signin-color-red"></span>
                                    </div>
                                </div>
                                <div class="aws-signin-general-button-box">
                                    <button id="next_button" type="button" class="aws-signin-button aws-signin-button-size-normal aws-signin-button-variant-primary aws-signin-button-width-full"><span id="next_button_text" class="aws-signin-color-white">Next</span></button>
                                </div>

                                <!-- New Account -->
                                <div id="new_account_container" class="aws-signin-new-account-box">
                                    <div class="signin-break-wrapper">
                                        <span class="aws-signin-color-mid-gray">New to AWS?</span>
                                    </div>
                                    <div class="aws-signin-general-button-box">
                                        <button id="create_aws_account" class="awsui-button awsui-button-size-normal awsui-button-variant-normal awsui-hover-child-icons aws-signin-button-width-full">Create a new AWS account</button>
                                    </div>
                                </div>
                            </div>

                            <!-- Root user -->
                            <div id="login_container" class="signin-container" style="display:none">
                                <div id="root_account_sign_in" class="aws-signin-login-header-box">
                                    <b class="awsui-text-bigger">Root user sign in</b>
                                    <div class="aws-signin-tool-tip" style="bottom:2px;">
                                        <span class="awsui-icon info-circle awsui-icon-has-hover"></span>
                                        <span class="aws-signin-tooltip-text aws-signin-tooltip-size-medium">
                                            <span>This sign-in page is for AWS account root users that have provided an account email. To sign in using IAM user credentials, choose "Sign in to a different account" below to return to the main sign-in page and enter your account ID or account alias.</span>
                                        </span>
                                    </div>
                                </div>
                                <div id="decoupled_email_container" class="aws-signin-general-input-box">
                                    <b>Email:</b> <span id="email_label" class="aws-signin-span-word-break"></span>
                                    <input id="email" type="hidden" value=" ">
                                </div>
                                <div class="aws-signin-general-label-box">
                                    <div class="aws-signin-general-link-box-no-margin main-table">
                                        <div class="aws-signin-float-left" style="width:40%;"><b>Password</b></div>
                                        <div class="aws-signin-float-right" style="text-align:right; width:58%;">
                                            <span id="root_forgot_password_link">Forgot password?</span>
                                        </div>
                                    </div>
                                </div>
                                <div class="aws-signin-general-input-box">
                                    <input id="password" type="password" class="aws-signin-textfield" autocorrect="off" autocapitalize="off">
                                    <div id="password_input_alert" class="signin-input-warning" style="display:none">
                                        <span id="password_input_alert_content" class="awsui-text-small aws-signin-color-red"></span>
                                    </div>
                                </div>
                                <div class="aws-signin-general-button-box">
                                    <button id="signin_button" type="button" class="aws-signin-button aws-signin-button-size-normal aws-signin-button-variant-primary" style="width:100%; !important;"><span id="signin_button_text" style="color:white; font-weight: bold;">Sign in</span></button>
                                </div>
                                <div class="aws-signin-general-link-box">
                                    <span id="change_account_link">Sign in to a different account</span>
                                </div>
                                <div class="aws-signin-general-link-box">
                                    <span id="create_a_new_account_link">Create a new AWS account</span>
                                </div>
                            </div>

                            <!-- Suspended User -->
                            <div id="suspended_user_container" class="signin-container" style="display:none; !important">
                                <div class="aws-signin-general-header-box">
                                    <b id="suspended_user_header" class="awsui-text-bigger">Amazon web service sign in</b>
                                </div>
                                <div class="aws-signin-general-paragraph">
                                    <span id="suspended_user_message">This AWS account is not accessible. If you just signed up with AWS, please try again at a later time.</span>
                                </div>
                                <div class="aws-signin-general-paragraph">
                                    <span id="suspended_user_please">Please</span>
                                    <a href="https://aws.amazon.com/forms/aws-mfa-support">contact our customer service team</a>
                                    <span id="suspended_user_assistance">for assistance.</span>
                                </div>
                                <div class="aws-signin-general-paragraph">
                                    <span id="suspended_user_logout">To logout, click</span>
                                    <a href="/oauth?Action=logout&amp;redirect_uri=aws.amazon.com">here.</a>
                                </div>
                            </div>

                            <!-- MFA -->
                            <div id="mfa_container" class="signin-container" style="display:none; !important">
