                                    <b id="mfa_display_header" class="awsui-text-bigger">Multi-factor authentication</b>
                                </div>
                                <div class="aws-signin-general-paragraph">
                                    <span id="mfa_display_text">Enter your MFA code below to finish signing in.</span>
                                </div>
                                <div class="aws-signin-general-input-box">
                                    <b>Email address:</b> <span id="mfa_email_label" class="aws-signin-span-word-break"></span>
                                </div>
                                <div class="aws-signin-general-label-box">
                                    <b>MFA code</b>
                                </div>
                                <div class="aws-signin-general-input-box">
                                    <input id="mfaCode" class="awsui-textfield awsui-textfield-type-text" maxlength="6" autocomplete="off" autocorrect="off" autocapitalize="off" type="text">
                                    <div id="mfaCode_input_alert" style="display:none">
                                        <span id="mfaCode_input_alert_content" class="awsui-text-small aws-signin-color-red">You must provide an MFA code</span>
                                    </div>
                                </div>
                                <div class="aws-signin-general-button-box">
                                    <button id="mfa_submit_button" type="button" class="aws-signin-button aws-signin-button-size-normal aws-signin-button-variant-primary" style="width:100%; !important;"><span id="mfa_submit_button_text" style="color:white; font-weight: bold;">Submit</span></button>
                                </div>
                                <div class="aws-signin-general-link-box">
                                    <span id="troubleshoot_mfa">Troubleshoot MFA</span>
                                </div>
                                <div class="aws-signin-general-link-box">
                                    <span id="cancel_mfa">Cancel</span>
                                </div>
                            </div>

                            <!-- MFA Device Confirm -->
                            <div id="mfa_device_confirm_container" class="signin-container" style="display:none; !important">
                                <div class="aws-signin-general-header-box">
                                    <b class="awsui-text-bigger" id="mfa_device_confirm_display_header">Troubleshoot MFA</b>
                                </div>
                                <div class="aws-signin-general-paragraph">
                                    <span id="mfa_device_confirm_display_message">Do you have your multi-factor authentication(MFA) device with you now?</span>
                                </div>
                                <div class="aws-signin-general-paragraph" style="text-align: center;">
                                    <label class="awsui-radio-button-wrapper-label">
                                        <input type="radio" id="radio_yes" name="mfa_device_available" class="awsui-radio-button-input" value="yes">
                                        <div class="awsui-radio-button-styled-button"></div>
                                    </label>
                                    <label for="radio_yes" class="awsui-radio-button-label" style="margin-right:40px;">
                                        <div>Yes</div>
                                    </label>
                                    <label class="awsui-radio-button-wrapper-label">
                                        <input type="radio" id="radio_no" name="mfa_device_available" class="awsui-radio-button-input" value="no">
                                        <div class="awsui-radio-button-styled-button"></div>
