                                <div class="aws-signin-general-input-box">
                                    <input type="text" id="resync_mfa_code2" class="awsui-textfield awsui-textfield-type-text" autocomplete="off" autocorrect="off" autocapitalize="off">
                                    <div id="resync_mfa_code2_input_alert" style="display:none">
