                                    <button id="resync_mfa_button" type="button" style="width:100%; !important;" class="aws-signin-button aws-signin-button-size-normal aws-signin-button-variant-primary"><span id="resync_mfa_button_text" style="color:white; font-weight: bold;">Resync MFA device</span></button>
                                </div>
                                <div class="aws-signin-general-link-box">
                                    <span id="cancel_mfa_resync">Cancel</span>
                                </div>
                            </div>

                            <!-- MFA Customer Support -->
                            <div id="mfa_customer_service_container" class="signin-container" style="display:none; !important">
                                <div class="aws-signin-general-header-box">
                                    <b id="mfa_customer_service_display_header" class="awsui-text-big">Contact AWS support</b>
                                </div>
                                <div class="aws-signin-general-paragraph">
                                    <span id="mfa_customer_service_display_message">If your multi-factor authentication (MFA) device is lost, damaged, or not working, contact AWS Support. A representative can verify your account ownership and deactivate your MFA settings.</span>
                                </div>
                                <div class="aws-signin-general-button-box">
                                    <button id="contact_mfa_customer_service_button" type="button" class="awsui-button awsui-button-size-normal awsui-button-variant-primary awsui-hover-child-icons" style="width:100%; !important;">Contact us</button>
                                </div>
                                <div class="aws-signin-general-paragraph aws-signin-general-link-box">
                                    <label>If you are an AWS Premium Support customer</label>
                                    <span id="contact_premium_support">contact the Premium Support team for assistance.</span>
                                </div>
                                <div class="aws-signin-general-link-box">
                                    <span id="cancel_customer_support">Cancel</span>
                                </div>
                            </div>

                            <!-- Captcha -->
