                                </div>
                                <div class="aws-signin-general-button-box">
                                    <button id="submit_captcha" type="button" class="awsui-button awsui-button-size-normal awsui-button-variant-primary awsui-hover-child-icons" style="width:100%; !important;">Submit</button>
                                </div>
                            </div>
                        </div>
